function Home() {
  const [projects, setProjects] = useState ([]);
  useEffect(() => {  
    axios
    .get("http://localhost:5003/project/")
    .then((response) => {
      console.log(response.data)
      setProjects( [...response.data] );
    })
    .catch((error) => {
      console.log(error);
    });
  },[]);



